import React from 'react';
import logo from './logo.svg';
import pokemons from './data.js';
import './App.css';

function Teste() {
  return (
    <div>
      <ul>
        <li>{this.pokemon.name}</li>
      </ul>
    </div>
  );
}

function App() {
  return (
    <div>
      {pokemons.map(el => <Teste pokemon={el} />)}
    </div>
  );
}

export default App;
